t.add("contactus.program-not-broken.text", "\u041f\u043e \u043d\u0430\u0448\u0438\u043c \u0434\u0430\u043d\u043d\u044b\u043c \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 <span class=\"blue-bolder\">%program%<\/span> \u0440\u0430\u0431\u043e\u0442\u0430\u0435\u0442 <b>\u043a\u043e\u0440\u0440\u0435\u043a\u0442\u043d\u043e<\/b>.", "contactus", "ru");
t.add("contactus.program-success-rate.text", "\u041f\u043e\u043a\u0430\u0437\u0430\u0442\u0435\u043b\u044c \u044d\u0444\u0444\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0441\u0442\u0438 \u044d\u0442\u043e\u0439 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u0440\u0430\u0432\u0435\u043d <span class=\"blue-bolder\">%SuccessRate%<\/span> (%SuccessRate% \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u043e\u0432 \u0431\u044b\u043b\u043e \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0437\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 24 \u0447\u0430\u0441\u0430).", "contactus", "ru");
