t.add("balance_expiration.error", "\u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0430\u0437 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043e\u0431\u043d\u043e\u0432\u043b\u044f\u043b\u0441\u044f %span_on%%count% \u0434\u0435\u043d\u044c \u043d\u0430\u0437\u0430\u0434%span_off% \u0438 \u0431\u044b\u043b\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 \u043e\u0448\u0438\u0431\u043a\u0430: %span2_on%\"%value%\"%span2_off%.|\u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0430\u0437 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043e\u0431\u043d\u043e\u0432\u043b\u044f\u043b\u0441\u044f %span_on%%count% \u0434\u043d\u044f \u043d\u0430\u0437\u0430\u0434%span_off% \u0438 \u0431\u044b\u043b\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 \u043e\u0448\u0438\u0431\u043a\u0430: %span2_on%\"%value%\"%span2_off%.|\u041f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u0440\u0430\u0437 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u043e\u0431\u043d\u043e\u0432\u043b\u044f\u043b\u0441\u044f %span_on%%count% \u0434\u043d\u0435\u0439 \u043d\u0430\u0437\u0430\u0434%span_off% \u0438 \u0431\u044b\u043b\u0430 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u0430 \u043e\u0448\u0438\u0431\u043a\u0430: %span2_on%\"%value%\"%span2_off%.", "email", "ru");
