t.add("agents.connect.thanks.message", "\u0421\u043f\u0430\u0441\u0438\u0431\u043e. \u041c\u044b \u0432\u044b\u0441\u043b\u0430\u043b\u0438 email \u043d\u0430 \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u0439 \u0412\u0430\u043c\u0438 \u0430\u0434\u0440\u0435\u0441 <span class=\"silver\">(%email%)<\/span>. \u041a\u0430\u043a \u0442\u043e\u043b\u044c\u043a\u043e \u044d\u0442\u043e\u0442 \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u043f\u0440\u0438\u043c\u0435\u0442 \u0412\u0430\u0448\u0435 \u043f\u0440\u0438\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435, \u0432\u044b \u043e\u0431\u0430 \u0441\u043c\u043e\u0436\u0435\u0442\u0435 \u0440\u0435\u0448\u0438\u0442\u044c, \u043a\u0430\u043a\u043e\u0439 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0435\u0439 \u043f\u043e\u0434\u0435\u043b\u0438\u0442\u044c\u0441\u044f \u0434\u0440\u0443\u0433 \u0441 \u0434\u0440\u0443\u0433\u043e\u043c \u0447\u0435\u0440\u0435\u0437 AwardWallet.", "messages", "ru");
t.add("agents.connect.user-found.message", "\u041f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u0441 \u0443\u043a\u0430\u0437\u0430\u043d\u043d\u044b\u043c email-\u0430\u0434\u0440\u0435\u0441\u043e\u043c <span class=\"silver\">(%email%)<\/span> \u043d\u0430\u0439\u0434\u0435\u043d \u0432 \u043d\u0430\u0448\u0435\u0439 \u0431\u0430\u0437\u0435", "messages", "ru");
