t.add("coupon.used-first-time-notice", "\u0422\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c, \u044d\u0442\u043e\u0442 \u043a\u0443\u043f\u043e\u043d \u043d\u0435 \u0441\u0440\u0430\u0431\u043e\u0442\u0430\u0435\u0442 \u0432 \u0412\u0430\u0448\u0435\u043c \u0441\u043b\u0443\u0447\u0430\u0435. \u0412 \u043d\u0435\u043c \u043d\u0435\u0442 \u043e\u0448\u0438\u0431\u043a\u0438, \u043f\u0440\u043e\u0441\u0442\u043e \u043e\u043d \u0431\u044b\u043b \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0430\u043d \u0434\u043b\u044f \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u0439, \u0443 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0434\u043e \u044d\u0442\u043e\u0433\u043e \u043d\u0435 \u0431\u044b\u043b\u043e \u043f\u0440\u0435\u043c\u0438\u0443\u043c-\u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430 AwardWallet Plus (\u0438 \u043e\u0431\u044b\u0447\u043d\u043e \u044d\u0442\u043e\u0442 \u043a\u043e\u0434 \u0432\u0432\u043e\u0434\u0438\u0442\u0441\u044f \u043f\u0440\u0438 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430). \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u0435 \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435, \u0447\u0442\u043e \u043d\u0430\u0448\u0430 \u043a\u043e\u043c\u0430\u043d\u0434\u0430 \u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0438 \u043d\u0435 \u0440\u0430\u0437\u0434\u0430\u0435\u0442 \u043a\u0443\u043f\u043e\u043d\u044b \u0441 \u043a\u043e\u0434\u0430\u043c\u0438. %bold_on%\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043d\u0435 \u043f\u0440\u043e\u0441\u0438\u0442\u0435 \u043d\u0430\u0441 \u043e\u0431\u043d\u043e\u0432\u0438\u0442\u044c \u0412\u0430\u0448 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0434\u043e \u043f\u0440\u0435\u043c\u0438\u0443\u043c-\u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430%bold_off%. \u041e\u0431\u043d\u043e\u0432\u0438\u0442\u044c \u0412\u0430\u0448 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0434\u043e \u043f\u0440\u0435\u043c\u0438\u0443\u043c-\u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430 \u0438\u043b\u0438 \u043f\u0440\u043e\u0434\u043b\u0438\u0442\u044c \u043f\u043e\u0434\u043f\u0438\u0441\u043a\u0443 \u043d\u0430 \u043f\u0440\u0435\u043c\u0438\u0443\u043c-\u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0441 \u043f\u043e\u043c\u043e\u0449\u044c\u044e \u0435\u0449\u0435 \u043e\u0434\u043d\u043e\u0433\u043e \u043a\u0443\u043f\u043e\u043d\u0430 (\u043d\u043e, \u043f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043d\u0435 \u043f\u0440\u043e\u0441\u0438\u0442\u0435 \u044d\u0442\u043e\u0442 \u043a\u0443\u043f\u043e\u043d \u0443 \u043d\u0430\u0441) \u0438\u043b\u0438 \u043e\u043f\u043b\u0430\u0442\u0438\u0432 \u043f\u043e\u0434\u043f\u0438\u0441\u043a\u0443. %bold_on%\u0422\u0435\u0445\u043f\u043e\u0434\u0434\u0435\u0440\u0436\u043a\u0430 AwardWallet \u043d\u0435 \u0440\u0430\u0437\u0434\u0430\u0435\u0442 \u043a\u0443\u043f\u043e\u043d\u044b%bold_off%.", "messages", "ru");
t.add("coupon.value", "\u0426\u0435\u043d\u043d\u043e\u0441\u0442\u044c", "messages", "ru");
t.add("create.business.text1", "\u0421\u043f\u0430\u0441\u0438\u0431\u043e, \u0412\u044b \u0441\u043e\u0437\u0434\u0430\u043b\u0438 \u0441\u0432\u043e\u0439 \u0431\u0438\u0437\u043d\u0435\u0441-\u0430\u043a\u043a\u0430\u0443\u043d\u0442.", "messages", "ru");
