t.add("credit-card.offer.popup.cards-table.title", "\u0421\u043f\u0438\u0441\u043e\u043a \u043a\u0430\u0440\u0442, \u0437\u0430\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u044e\u0449\u0438\u0445 \u0431\u043e\u043b\u044c\u0448\u0435 1\u0445 \u0432 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 %strong_on%%category%%strong_off%:", "messages", "ru");
