t.add("credit-card.offer.popup.merchant-reverse", "\u041d\u0430 \u0434\u0430\u043d\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u043f\u0440\u043e\u0434\u0430\u0432\u0446\u044b \u0437\u0430\u0440\u0430\u0431\u0430\u0442\u044b\u0432\u0430\u044e\u0442 %strong_on%%multiplier%%strong_off% \u0432 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 %strong_on%%category%%strong_off%:", "messages", "ru");
t.add("credit-card.offer.popup.merchant.info", "\u0412\u044b \u043f\u043e\u0442\u0440\u0430\u0442\u0438\u043b\u0438 %strong_on%%amount%%strong_off% \u043d\u0430 %strong_on%%description%%strong_off% \u0438 \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438 %strong_on%%miles%%strong_off% \u0431\u043e\u043d\u0443\u0441\u043e\u0432 %up-counter-on%%multiplier%%up-counter-off%, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f \u043a\u0430\u0440\u0442\u0443 %cardname%. \u0421 \u0443\u0447\u0435\u0442\u043e\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0430\u043d\u043d\u044b\u0445 \u0438 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u043e \u0442\u043e\u043c, \u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0438 AwardWallet \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438 \u0441 %strong_on%%merchant%%strong_off% \u0432 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 %strong_on%%category%%strong_off%, \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0431\u043e\u043b\u044c\u0448\u0435 \u0431\u043e\u043d\u0443\u0441\u043e\u0432, \u0435\u0441\u043b\u0438 \u043d\u0430\u0447\u043d\u0435\u0442\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043a\u0440\u0435\u0434\u0438\u0442\u043d\u0443\u044e \u043a\u0430\u0440\u0442\u0443 \u0441 \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u0431\u043e\u043d\u0443\u0441\u043d\u044b\u043c\u0438 \u0431\u0430\u043b\u043b\u0430\u043c\u0438.", "messages", "ru");
t.add("credit-card.offer.popup.merchant.info-analysis", "\u0412\u044b \u043f\u043e\u0442\u0440\u0430\u0442\u0438\u043b\u0438 %strong_on%%amount%%strong_off% \u043d\u0430 %strong_on%%description%%strong_off% \u0438 \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438 %strong_on%%miles%%strong_off% \u0431\u0430\u043b\u043b\u043e\u0432 %up-counter-on%%multiplier%%up-counter-off%. \u0421 \u0443\u0447\u0435\u0442\u043e\u043c \u0441\u043e\u0431\u0440\u0430\u043d\u043d\u044b\u0445 \u0434\u0430\u043d\u043d\u044b\u0445 \u0438 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u0438 \u043e \u0442\u043e\u043c, \u0441\u043a\u043e\u043b\u044c\u043a\u043e \u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u0435\u043b\u0438 AwardWallet \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u043b\u0438 \u0441 %strong_on%%merchant%%strong_off% \u0432 \u043a\u0430\u0442\u0435\u0433\u043e\u0440\u0438\u0438 %strong_on%%category%%strong_off%, \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u0437\u0430\u0440\u0430\u0431\u043e\u0442\u0430\u0442\u044c \u0431\u043e\u043b\u044c\u0448\u0435 \u0431\u043e\u043d\u0443\u0441\u043e\u0432, \u0435\u0441\u043b\u0438 \u043d\u0430\u0447\u043d\u0435\u0442\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043a\u0440\u0435\u0434\u0438\u0442\u043d\u0443\u044e \u043a\u0430\u0440\u0442\u0443 \u0441 \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u0431\u043e\u043d\u0443\u0441\u043d\u044b\u043c\u0438 \u0431\u0430\u043b\u043b\u0430\u043c\u0438.", "messages", "ru");
