t.add("updater2.messages.error.limit", "\u041f\u0440\u0435\u0432\u044b\u0448\u0435\u043d \u043b\u0438\u043c\u0438\u0442 \u043e\u0431\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0439 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u0430. \u0417\u0430 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 24 \u0447\u0430\u0441\u0430 \u0412\u044b \u0443\u0436\u0435 \u043e\u0431\u043d\u043e\u0432\u0438\u043b\u0438 \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0434\u0432\u0430\u0436\u0434\u044b. \u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043e\u0431\u043d\u043e\u0432\u0438\u0442\u0435\u0441\u044c \u0434\u043e AwardWallet Plus, \u0435\u0441\u043b\u0438 \u0412\u044b \u0445\u043e\u0442\u0438\u0442\u0435 \u043e\u0431\u043d\u043e\u0432\u043b\u044f\u0442\u044c \u0412\u0430\u0448\u0438 \u0430\u043a\u043a\u0430\u0443\u043d\u0442\u044b \u0447\u0430\u0449\u0435, \u0438\u043b\u0438 \u043f\u043e\u0434\u043e\u0436\u0434\u0438\u0442\u0435 %timeleft%, \u0447\u0442\u043e\u0431\u044b \u043e\u0431\u043d\u043e\u0432\u0438\u0442\u044c \u0430\u043a\u043a\u0430\u0443\u043d\u0442 \u0441\u043d\u043e\u0432\u0430.", "messages", "ru");
