t.add("location.android.finder_disabled", "\u041e\u043f\u0446\u0438\u044f \u043e\u0442\u043a\u043b\u044e\u0447\u0435\u043d\u0430. \u0415\u0435 \u0430\u043a\u0442\u0438\u0432\u0430\u0446\u0438\u044f \u043f\u043e\u0437\u0432\u043e\u043b\u0438\u0442 \u043d\u0430\u043c \u0432\u044b\u0432\u043e\u0434\u0438\u0442\u044c \u0431\u043e\u043d\u0443\u0441\u043d\u044b\u0435 \u043a\u0430\u0440\u0442\u044b (\u0441\u043e \u0448\u0442\u0440\u0438\u0445\u043a\u043e\u0434\u043e\u043c) \u043d\u0430 \u044d\u043a\u0440\u0430\u043d \u0412\u0430\u0448\u0435\u0433\u043e \u043c\u043e\u0431\u0438\u043b\u044c\u043d\u043e\u0433\u043e \u0442\u0435\u043b\u0435\u0444\u043e\u043d\u0430 \u043f\u0440\u0438 \u043f\u0440\u0438\u0431\u043b\u0438\u0436\u0435\u043d\u0438\u0438 \u043a \u043c\u0430\u0433\u0430\u0437\u0438\u043d\u0443 \u0438\u043b\u0438 \u0440\u0435\u0441\u0442\u043e\u0440\u0430\u043d\u0443.", "mobile\u002Dnative", "ru");
